import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AuthProvider from './components/AuthProvider';
import Login from './components/Login';
import Register from './components/Register';
import AnnotateImage from './components/annotate';
import UploadImages from './components/upload';
import ImageAnnotation from './components/imageannotation';
import ImageTable from './components/list';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <PrivateRoute path="/annotate" element={<AnnotateImage />} />
        <PrivateRoute path="/upload" element={<UploadImages />} />
        <PrivateRoute path="/imageannotation/:requestID" element={<ImageAnnotation />} />  
        <PrivateRoute path="/list" element={<ImageTable />} />
      </Routes>
    </Router>
  );
};

ReactDOM.render(
  <AuthProvider>
    <App />
  </AuthProvider>,
  document.getElementById('root')
);
